import ClassComponent from "./ClassComponent";
import "./App.css";

function App() {
  const classes = [
    { name: "asdsad", finished: true },
    { name: "sadfasefre", finished: false },
    { name: "dfer", finished: true },
    { name: "fghg", finished: false },
    { name: "yujyt", finished: true },
    { name: "ewdcxd", finished: false },
  ];

  return (
    <div className="App">
      {classes.map((classItem, index) => {
        return (
          <ClassComponent key = {index} name = {classItem.name} finished = {classItem.finished}/>
        ); 
      })}
    </div>
  );
}

export default App;
